import React, { useState } from 'react';
import './ContactUs.css';

const ContactUsForm = () => {
  // State for Customer Information
  const [formData, setFormData] = useState({
    fullName: '',
    phoneNumber: '',
    email: '',
    address: '',
  });

  // State for Wedding Details
  const [weddingDetails, setWeddingDetails] = useState({
    weddingDate: '',
    weddingCity: '',
    brideName: '',
    groomName: '',
    numberOfGuests: '',
    eventDuration: '',
  });

  // Handle Change for Customer Info
  const handleCustomerChange = (e) => {
    const { name, value } = e.target;
    setFormData({
      ...formData,
      [name]: value,
    });
  };

  // Handle Change for Wedding Details
  const handleWeddingChange = (e) => {
    const { name, value } = e.target;
    setWeddingDetails({
      ...weddingDetails,
      [name]: value,
    });
  };

  // Handle Submit
  const handleSubmit = (e) => {
    e.preventDefault();
    // You can handle form submission logic here (save to database or move to next step)
    console.log(formData, weddingDetails);
  };

  return (
    <div className="form-container">
      <h2>We are delighted you are here! Tell us about yourself</h2>
      <form onSubmit={handleSubmit}>
        {/* Customer Information Section */}
        <div className="form-section">
          <h3>Customer Information</h3>
          
          <div className="form-group">
            <label htmlFor="fullName">Full Name:</label>
            <input
              type="text"
              id="fullName"
              name="fullName"
              value={formData.fullName}
              onChange={handleCustomerChange}
              required
            />
          </div>

          <div className="form-group">
            <label htmlFor="phoneNumber">Phone Number:</label>
            <input
              type="text"
              id="phoneNumber"
              name="phoneNumber"
              value={formData.phoneNumber}
              onChange={handleCustomerChange}
              required
            />
          </div>

          <div className="form-group">
            <label htmlFor="email">Email Address:</label>
            <input
              type="email"
              id="email"
              name="email"
              value={formData.email}
              onChange={handleCustomerChange}
              required
            />
          </div>

          <div className="form-group">
            <label htmlFor="address">Address:</label>
            <input
              type="text"
              id="address"
              name="address"
              value={formData.address}
              onChange={handleCustomerChange}
              required
            />
          </div>
        </div>

        {/* Wedding Details Section */}
        <div className="form-section">
          <h3>Wedding Details</h3>

          <div className="form-group">
            <label htmlFor="weddingDate">Wedding Date:</label>
            <input
              type="date"
              id="weddingDate"
              name="weddingDate"
              value={weddingDetails.weddingDate}
              onChange={handleWeddingChange}
              required
            />
          </div>

          <div className="form-group">
            <label htmlFor="weddingCity">Wedding City:</label>
            <input
              type="text"
              id="weddingCity"
              name="weddingCity"
              value={weddingDetails.weddingCity}
              onChange={handleWeddingChange}
              required
            />
          </div>

          <div className="form-group">
            <label htmlFor="brideName">Bride's Name:</label>
            <input
              type="text"
              id="brideName"
              name="brideName"
              value={weddingDetails.brideName}
              onChange={handleWeddingChange}
              required
            />
          </div>

          <div className="form-group">
            <label htmlFor="groomName">Groom's Name:</label>
            <input
              type="text"
              id="groomName"
              name="groomName"
              value={weddingDetails.groomName}
              onChange={handleWeddingChange}
              required
            />
          </div>

          <div className="form-group">
            <label htmlFor="numberOfGuests">Number of Guests:</label>
            <input
              type="number"
              id="numberOfGuests"
              name="numberOfGuests"
              value={weddingDetails.numberOfGuests}
              onChange={handleWeddingChange}
              required
            />
          </div>

          <div className="form-group">
            <label htmlFor="eventDuration">Event Duration (in days):</label>
            <input
              type="number"
              id="eventDuration"
              name="eventDuration"
              value={weddingDetails.eventDuration}
              onChange={handleWeddingChange}
              required
            />
          </div>
        </div>

        <button type="submit">Next Step</button>
      </form>
    </div>
  );
};

export default ContactUsForm;
